import React from "react";
import "./inlogpage.css"
import PinknavLeft from "../../Components/Pinknav/pinknav-left";
import { useForm } from 'react-hook-form';

function InlogPage(){
    const { register, handleSubmit } = useForm();
    function onFormSubmit(data) {
        console.log(data);
    }
    return(
        <>
        <PinknavLeft/>

            <header className='inner-container-right header-inlog'>
                <div>
                  <h1> Inloggen</h1>
                 </div>
            </header>
            <section className='inner-container-right registration'>
                <form onSubmit={handleSubmit(onFormSubmit)}>

                        <label htmlFor="Email">
                            Email:
                            <input
                            type="email"
                            {...register("email", {
                                validate: (value) => value.includes('@'),
                            })}
                                />
                        </label>

                    <label htmlFor="Password">
                        Password:
                        <input
                            type="password"
                            {...register("Password", {
                                validate: (value) => value.includes('2'),
                            })}
                        />
                    </label>






                        <button type="submit">
                            Versturen
                        </button>

                </form>
            </section>
        </>
    )

};

export default InlogPage
